import './styles/styles.css';
const Footer = () => {
    return (
        <footer className="footer-component row w-100 align-items-end">
            <div className="col d-flex justify-content-center align-items-center"><p className='mt-2 text-white'>Show News</p></div>            
        </footer>
        )
}
export default Footer;
